BEGIN TRANSACTION;
SET CONSTRAINTS ALL DEFERRED;
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
CREATE TABLE "customers" ("id" SERIAL PRIMARY KEY NOT NULL, "userid" varchar(255), "firstname" varchar(255), "lastname" varchar(255), "email" varchar(255), "created_at" timestamp, "updated_at" timestamp);
CREATE TABLE "locations" ("id" SERIAL PRIMARY KEY NOT NULL, "code" varchar(255), "name" varchar(255), "address" varchar(255), "created_at" timestamp, "updated_at" timestamp);
CREATE TABLE "statuses" ("id" SERIAL PRIMARY KEY NOT NULL, "name" varchar(255), "description" varchar(255), "created_at" timestamp, "updated_at" timestamp);
CREATE TABLE "activities" ("id" SERIAL PRIMARY KEY NOT NULL, "request_id" integer, "status_id" integer, "date" date, "note" text, "created_at" timestamp, "updated_at" timestamp);
CREATE TABLE "requests" ("id" SERIAL PRIMARY KEY NOT NULL, "customer_id" integer, "oclcnum" integer, "title" varchar(255), "author" varchar(255), "pub" varchar(255), "locationplaced" varchar(255), "location_id" integer, "duedate" date, "bclitem" bigint, "created_at" timestamp, "updated_at" timestamp, "dateplaced" date);
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
COMMIT;
